// import 'Ourwork.css'
import "../ourwork/Ourwork.css"


function Ourwork() {
  const [items, setItems] = useState(Ourworkmenu);

  return (
  <>
    <div class="container">
    <h1>Our Work</h1>
    <div className="menu-tab d-flex justify-content-around">
      <button className="btn btn-warning">All Works</button>
      <button className="btn btn-warning">Web</button>
      <button className="btn btn-warning">Design</button>
      <button className="btn btn-warning">Brand</button>
    </div>
  </div>
  <div className="menu-item container-fluid mt-5">
    <div className="row">
      <div className="col-11 mx-auto">
        <div className="row my-5">
        {
          items.map((elem) =>{
            const{id, img, category} = elem;

            return(
              <div className="item1 col-12 col-md col-md-6 col-lg-6 col-xl-4 ">
            <div className="row Item-inside">
            {/* for img */}
              <div className="col-12 col-md-12 col-lg-4 img-div">
              <img src="" alt="menuPic" className="img-fluid"/>
              </div>
              
            </div>
          </div>

            )
        })
        }
          
        </div>
      </div>
    </div>
</div>
  </>
  )
}

export default Ourwork
